:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Emily Jane and GRAY, Charles
  IGRAY, Robert Leonard and LANGFORD, Margaret
  09> GRAY, Robert Mowbray
  b 04.04.1922 d 14.08.1944
  Robert b. at Gisborne and killed in WW2.
  10> GRAY, Olive Sheila m on 08.06.1946 to (1) TOMBLESON, Michael John
  b 23.07.1923
  b 25.08.1921 d 22.08.1971
  Sheila b. at Eketahuna and m, at Gisborne. Michael, s/o Percy Douglas Tombleson and Mary Dods, killed
  in a car accident and bd. at Morrinsville.
  Sheila was a landgirl during the war. Michael was a sheepfarmer. They farmed at "Okiwa" Station,
  Waimata Valley, Gisborne after the war and then at Te Akau in the Waikato (1957) before moving to
  Morrinsville in 1966.
  01> TOMBLESON, Carol Mary m on 13.01.1968 to SHERRARD, Lester Albert
  b 01.10.1947
  b 24.10.1942 d 23.02.1982
  Carol b. at Gisborne and m. at Morrinsville. Lester, s/o John and Mabel Sherrard, b. at Dannevirke
  and d. and bd. at Ngaruawahia. Address: 9 Old Taupiri Road, Ngaruawahia.
  Carol attended Woodford House and Hamilton Teachers' College. She returned to teaching in 1980 and
  is now at Taupiri Primary School.
  01> SHERRARD, Amanda Lee
  b 02.10.1970
  Amanda b. at Huntly. She works for the New Zealand Dairy Board at the Livestock Improvement
  Centre in Hamilton.
  02> SHERRARD, Karn Michael
  b 03.09.1972
  Karn b. at Huntly. He attended Waikato Polytech in 1991 and now works as a technician for U-Bix
  in Hamilton.
  02> TOMBLESON, Guy Leonard m on 27.08.1983 to PEACOCK, Ruth
  b 25.10.1949 d 30.03.1992
  b 24.06.1953
  Guy m, at Redmire, North Yorks, England. Ruth, d/o Tom and Annie Peacock of Redmire. Address:
  Priory House, Redmire, Leyburn, North Yorkshire, England DL8 4ED.
  Guy had an antique shop in Leyburn, North Yorkshire, before returning to New Zealand. After his
  death in Auckland, Ruth returned to England with the two girls.
  01> TOMBLESON, Annie Louise
  b 08.02.1986
  02> TOMBLESON, Sophie May
  b 10.12.1988
  03> TOMBLESON, Anne Juliet m on 12.03.1988 to PINCHEN, Wilfred
  b 01.01.1956
  b 13.02.1944
  Anne b. at Gisborne and m, at St John's Anglican Church, Albany, Western Australia. Wilfred, s/o
  Norman Arthur Pinchen and Nora Teasdale, b. at Hartepool, England. Address: RMB 8626c Lower Kalgan,
  Albany 6330, West Australia.
  Anne attended Te Akau Primary School then Morrinsville College where she was a Prefect, Chairman of
  the School Council, House Captain and captain of the girls' hockey team. She graduated from
  Hamilton Teachers' College in 1976. She quit teaching after a short time and held several diverse
  positions around Auckland and Pukekohe. In 1984 she went to Albany where she managed a fast food
  outlet for four years and it was during that time that she met and married Wilf who was a storeman
